import forms from "./formEntrance.json";

export function getName() {
  return (
    forms.map((form)=> {
    return(
        <form>
      <label for={form.id}> {form.name} </label>
      <br></br>
      <input
        type={form.type} placeholder={form.placeholder} id={form.id} name={form.name}/>
    </form>
    )
    })
  );
}
